import React from 'react'
import { useTranslation } from 'react-i18next';
import { tagsList } from "./tagslist";


const Taglist = () => {
  const { t } = useTranslation();

  return (
    <div>
            {tagsList.map((tag, index) => (
                <div className="tag" key={index}>
                    <h5>{t(tag.tagName)}</h5>
                    <p>{t(tag.tagDesc)}</p>
                </div>
            ))}
        </div>
  )
}

export default Taglist
